// src/components/Registration.js
import React, { useState } from 'react';
import { Container, Form, Button } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';
import api from '../utils/api';

const Registration = () => {
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    email: '',
    phoneNumber: '',
    dateOfBirth: '',
    username: '',
    password: '',
    confirmPassword: '',
    challengeQuestion1: '',
    response1: '',
    donorId: '',
  });

  const navigate = useNavigate();

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (formData.password !== formData.confirmPassword) {
      alert('Passwords do not match.');
      return;
    }
    try {
      const response = await api.post('/auth/signup', {
        firstName: formData.firstName,
        lastName: formData.lastName,
        email: formData.email,
        phoneNumber: formData.phoneNumber,
        dateOfBirth: formData.dateOfBirth,
        username: formData.username,
        password: formData.password,
        challengeQuestion1: formData.challengeQuestion1,
        response1: formData.response1,
        donorId: formData.donorId,
      });
      alert('Registration successful!');
      navigate('/donate-blood');
    } catch (error) {
      alert('Error during registration.');
      console.error(error);
    }
  };

  return (
    <Container>
      <h2>Donor Registration</h2>
      <Form onSubmit={handleSubmit}>
        <Form.Group>
          <Form.Label>Legal First Name</Form.Label>
          <Form.Control type="text" name="firstName" onChange={handleChange} required />
        </Form.Group>
        <Form.Group>
          <Form.Label>Last Name</Form.Label>
          <Form.Control type="text" name="lastName" onChange={handleChange} required />
        </Form.Group>
        <Form.Group>
          <Form.Label>Email Address</Form.Label>
          <Form.Control type="email" name="email" onChange={handleChange} required />
        </Form.Group>
        <Form.Group>
          <Form.Label>Phone #</Form.Label>
          <Form.Control type="tel" name="phoneNumber" onChange={handleChange} required />
        </Form.Group>
        <Form.Group>
          <Form.Label>Date of Birth</Form.Label>
          <Form.Control type="date" name="dateOfBirth" onChange={handleChange} required />
        </Form.Group>
        <Form.Group>
          <Form.Label>Select a Username</Form.Label>
          <Form.Control type="text" name="username" onChange={handleChange} required />
        </Form.Group>
        <Form.Group>
          <Form.Label>Password</Form.Label>
          <Form.Control type="password" name="password" onChange={handleChange} required />
        </Form.Group>
        <Form.Group>
          <Form.Label>Confirm Password</Form.Label>
          <Form.Control type="password" name="confirmPassword" onChange={handleChange} required />
        </Form.Group>
        <Form.Group>
          <Form.Label>Challenge Question #1</Form.Label>
          <Form.Control as="select" name="challengeQuestion1" onChange={handleChange} required>
            <option value="">Select a question</option>
            <option value="What is your mother's maiden name?">What is your mother's maiden name?</option>
            <option value="What was your first pet's name?">What was your first pet's name?</option>
            <option value="What city were you born in?">What city were you born in?</option>
          </Form.Control>
        </Form.Group>
        <Form.Group>
          <Form.Label>Your Response</Form.Label>
          <Form.Control type="text" name="response1" onChange={handleChange} required />
        </Form.Group>
        <Form.Group>
          <Form.Label>Donor ID (if any)</Form.Label>
          <Form.Control type="text" name="donorId" onChange={handleChange} />
        </Form.Group>
        <Button type="submit" variant="danger">Register</Button>
      </Form>
    </Container>
  );
};

export default Registration;
